export const hoverNav = status => {
    return {
        type: 'HOVER_NAV',
        payload: status
    };
};

export const navChangeStyle = bool => {
    return {
        type: 'CHANGE_NAV_STYLE',
        payload: bool
    };
};

export const enterMainPage = () => {
    return {
        type: 'ON_MAIN_PAGE'
    };
};

export const leaveMainPage = () => {
    return {
        type: 'OFF_MAIN_PAGE'
    };
};
